-- VISTA N° 1
-- TOP DE LOS 10 EMPLEADOS MEJORES PAGADOS ORDERNADO POR SUELDO

CREATE OR REPLACE VIEW VW_LISTAREMPLEADOPAGOS
AS
SELECT * FROM ( SELECT IDEMPLEADO "CODIGO EMPLEADO",RTRIM(APELLIDO_PATERNO) || ' ' ||RTRIM(APELLIDO_MATERNO) || ' ' || RTRIM(NOMBRES) "APELLIDOS Y NOMBRES" ,
                                       DNI "NUMERO DNI",SUELDO "SUELDO"
                          FROM EMPLEADOS
                          ORDER BY SUELDO DESC  )
WHERE ROWNUM  <= 10

SELECT * FROM  VW_LISTAREMPLEADOPAGOS

-- VISTA N° 2
-- CALCULAR LA CANTIDAD DE CLIENTES POR DISTRITOS 
CREATE OR REPLACE VIEW VW_CANTIDADCLIENTESDISTRITOS
AS
SELECT * FROM (SELECT D.DETALLE,COUNT(C.IDDISTRITO) "CANTIDAD DE CLIENTES"
FROM CLIENTES C,DISTRITOS D
WHERE C.IDDISTRITO = D.IDDISTRITO
GROUP BY  D.DETALLE,C.IDDISTRITO
ORDER BY 1)

SELECT * FROM VW_CANTIDADCLIENTESDISTRITOS

-- VISTA N° 3
-- VENTA DE PASAJES CON LOS PRECIOS MAS BARATOS  LAS PRIMERAS 20
CREATE OR REPLACE VW_VENTASMASBARATAS
AS
SELECT * FROM ( SELECT IDVENTA, RTRIM(C.APELLIDO_PATERNO) || ' ' ||RTRIM(C.APELLIDO_MATERNO) || ' ' || RTRIM(C.NOMBRE) "NOMBRE DE CLIENTE" ,
              RTRIM(E.APELLIDO_PATERNO) || ' ' ||RTRIM(E.APELLIDO_MATERNO) || ' ' || RTRIM(E.NOMBRES) "NOMBRE DE VENDEDOR" ,
              VDP.PRECIO_PASAJE "PRECIO DE PASAJE"   ,VDP.FECHA_VENTA "FECHA DE VENTA"
FROM VENTAS_DE_PASAJES VDP,CLIENTES C,EMPLEADOS E
WHERE VDP.IDCLIENTE = C.IDCLIENTE AND VDP.IDPERSONAL = E.IDEMPLEADO  AND  VDP.PRECIO_PASAJE  < (SELECT AVG(PRECIO_PASAJE) FROM VENTAS_DE_PASAJES )
ORDER BY  VDP.PRECIO_PASAJE DESC )
WHERE ROWNUM <= 20

SELECT * FROM VW_VENTASMASBARATAS

-- VISTA N° 4
--  MONTO TOTAL POR PAQUETES REALIZADOS
CREATE OR REPLACE VIEW VW_VENTASPORMES
AS
SELECT * FROM (
SELECT  VPT.IDPAQUETE,PT.NOMBRE_PAQUETE,SUM(VPT.PRECIO) "MONTO TOTAL"
FROM VENTAS_DE_PAQUETES_TURISTICO VPT ,PAQUETES_TURISTICOS PT
WHERE VPT.IDPAQUETE = PT.IDPAQUETE
GROUP BY VPT.IDPAQUETE,PT.NOMBRE_PAQUETE
)

SELECT * FROM VW_VENTASPORMES

-- VISTA N° 5
--  CANTIDAD DE CLIENTES POR SEXO
CREATE OR REPLACE VIEW VW_CANTIDADPORSEXO
AS
SELECT * FROM (SELECT SEXO,COUNT(IDCLIENTE) "CANTIDAD CLIENTES"
FROM CLIENTES
GROUP BY SEXO )

SELECT * FROM VW_CANTIDADPORSEXO

-- VISTA N° 6
--  CANTIDAD DE EMPLADOS CONTRATADOS POR AÑO
CREATE OR REPLACE VIEW  VW_CONTRATOEMPLEADOS
AS
SELECT EXTRACT(YEAR FROM FECHACONTRATACION) "AÑO",COUNT(IDEMPLEADO) "CANTIDAD DE CONTRATADOS"
FROM EMPLEADOS
GROUP BY  EXTRACT(YEAR FROM FECHACONTRATACION)
ORDER BY 1 

SELECT * FROM VW_CONTRATOEMPLEADOS

-- VISTA N° 7
--  MONTO TOTAL POR CADA MES DE AÑO 2015 DE LA VENTA DE PAQUETE TURISTICOS
CREATE OR  REPLACE VIEW VW_VENTAPAQUETESTURISTICOS
AS
SELECT * FROM ( SELECT EXTRACT(MONTH FROM FECHA_VENTA) "N° DE MES",SUM(PRECIO) "MONTO VENDIDO"
FROM VENTAS_DE_PAQUETES_TURISTICO
WHERE  EXTRACT(YEAR FROM FECHA_VENTA) =  '2015'
GROUP BY  EXTRACT(MONTH FROM FECHA_VENTA)
ORDER BY 1 )

SELECT * FROM VW_VENTAPAQUETESTURISTICOS

-- VISTA N° 8
--  MONTO TOTAL POR CADA MES DE AÑO 2015 DE LA VENTA DE PASAJES
CREATE OR  REPLACE VIEW VW_VENTAPASAJES
AS
SELECT * FROM (
SELECT EXTRACT(MONTH  FROM FECHA_VENTA) "NUMERO DE MES",SUM(PRECIO_PASAJE)
FROM  VENTAS_DE_PASAJES
WHERE  EXTRACT(YEAR FROM FECHA_VENTA) =  '2015'
GROUP BY  EXTRACT(MONTH FROM FECHA_VENTA)
ORDER BY 1 )

SELECT * FROM VW_VENTAPASAJES

-- VISTA N° 9
--  DETALLE DE LOS VUELOS 
CREATE OR REPLACE VIEW VW_DETALLEVUELOS
AS
SELECT V.IDVUELO"NUMERO DE VUELO",A.NOMBRE "AEROLINEA",C.DETALLE "CIUDAD ORIGEN",C.DETALLE "CIUDAD LLEGADA",TV.DETALLE "TIPO VIAJE",
                           CT.DETALLE "CLASE TURISTA",FECHASALIDA "FECHA SALIDA",HORA_SALIDA "HORA SALIDA",HORA_LLEGADA "HORA LLEGADA",DURACION_VIAJE "DURACION DE VIAJE"
FROM VUELOS V,AEROLINEAS A,CIUDADES C,TIPOS_DE_VIAJES TV,CLASE_DE_TURISTA CT
WHERE V.AEROLINEA = A.IDAEROLINEA AND V.CIUDAD_ORIGEN = C.IDCIUDAD AND V.TIPO_VIAJE = TV.IDTIPOVIAJE AND V.CLASE_TURISTA = CT.IDCLASETURISTA

SELECT * FROM VW_DETALLEVUELOS

-- VISTA N° 10
--  CANTIDAD DE TODOS LOS VENDEDORES POR DISTRITO DE SEXO MASCULINO
CREATE OR REPLACE VIEW VW_VENDEDORESPORDISTRITO
AS
SELECT E.IDDISTRITO "CODIGO DISTRITO",D.DETALLE "NOMBRE DISTRITO",COUNT(E.IDEMPLEADO) "CANTIDAD EMPLEADOS"
FROM EMPLEADOS E,DISTRITOS D
WHERE  (E.IDDISTRITO = D.IDDISTRITO) AND E.SEXO = 'M ' AND IDCARGO = 'CR001'
GROUP BY E.IDDISTRITO,D.DETALLE
ORDER BY 1

SELECT * FROM VW_VENDEDORESPORDISTRITO

