-- PROC N°1
-- GENERAR LA SALIDA DE UN EMPLEADO A TRAVES DE SU CODIGO
CREATE OR REPLACE PROCEDURE USP_GENERARSALIDAEMPLEADO (PIDEMPLEADO IN NCHAR, PFECHASALIDA IN DATE )
IS 
BEGIN 
UPDATE EMPLEADOS SET   FECHASALIDA = PFECHASALIDA
WHERE IDEMPLEADO = PIDEMPLEADO;
END;

BEGIN
USP_GENERARSALIDAEMPLEADO ('EM00000001','04/10/2015');
END;
-- PROC N°2
--  HACER UN DESCUENTO DE 10% DEL PRECIO DEL PASAJE A AQUELLAS VENTAS QUE SOBREPASEN  CIERTO MONTO
CREATE OR REPLACE PROCEDURE USP_APLICARDESCUENTO (PRECIO IN NUMBER)
AS
BEGIN
UPDATE VENTAS_DE_PASAJES SET  DESCUENTO = PRECIO_PASAJE * 0.1
WHERE PRECIO_PASAJE  > PRECIO  ;
END;
select * from VENTAS_DE_PASAJES
BEGIN
 USP_APLICARDESCUENTO (2000);
END;

-- PROC N°3
--  AUMENTAR EL PRECIO DE VENTA DEL PAQUETE DE ACUERDO A SU CODIGO  Y EL PORCENTAJE
CREATE OR REPLACE PROCEDURE USP_ALTERAR_PRECIO (PAQUETE IN NCHAR,PORCENTAJE IN NUMBER)
AS
BEGIN
UPDATE VENTAS_DE_PAQUETES_TURISTICO SET  PRECIO = PRECIO + (PRECIO *( PORCENTAJE / 100 ) )
WHERE IDPAQUETE = PAQUETE ;
END;

BEGIN
USP_ALTERAR_PRECIO ('PQ001',10);
END;

BEGIN
USP_ALTERAR_PRECIO ('PQ002',80);
END;

