-- PROC N°6
--  LISTADO DE CLIENTES NACIDOS ENTRE UN INTERVALO DE FECHAS DE SEXO MASCULINO  CUYO RUC EMPIEZE 20
CREATE OR REPLACE PROCEDURE USP_LISTAR_CLIENTES (CRS OUT SYS_REFCURSOR,FECH_IN IN DATE,FECH_FI IN DATE)
AS
BEGIN
OPEN CRS FOR  
SELECT  IDCLIENTE "CODIGO CLIENTE",RTRIM(C.APELLIDO_PATERNO) || ' ' ||RTRIM(C.APELLIDO_MATERNO) || ' ' || RTRIM(C.NOMBRE) "NOMBRE DE CLIENTE" ,
               FECHA_NACIMIENTO "FECHA NACIMIENTO",SEXO,ESTADO_CIVIL "ESTADO CIVIL",DNI,RUC,DIRECCION,EMAIL,TELEFONOS,CELULAR
FROM CLIENTES C INNER JOIN DISTRITOS D ON C.IDDISTRITO = D.IDDISTRITO
WHERE  (FECHA_NACIMIENTO BETWEEN FECH_IN AND FECH_FI ) AND SEXO = 'M'  AND RUC LIKE '20%' 
ORDER BY  FECHA_NACIMIENTO ;
END;

VARIABLE TABLA REFCURSOR;
EXEC USP_LISTAR_CLIENTES(:TABLA,'15/11/94','10/10/95');
PRINT TABLA

-- PROC N°7
--  OBTENER EL TIEMPO DE SERVICIO DE LOS EMPLEADOS HASTA LA FECHA ACTUAL ORDENADO POR TIEMPO DE SERVICIO DESC
CREATE OR REPLACE PROCEDURE USP_TIEMPO_SERVICIO (CRS OUT SYS_REFCURSOR)
AS
BEGIN
OPEN CRS FOR
SELECT IDEMPLEADO "CODIGO EMPLEADO",RTRIM(E.APELLIDO_PATERNO) || ' ' ||RTRIM(E.APELLIDO_MATERNO) || ' ' || RTRIM(E.NOMBRES) "NOMBRE DE EMPLEADO" ,
              FECHACONTRATACION "FECHA INGRESO",EXTRACT(YEAR FROM SYSDATE) - EXTRACT (YEAR FROM FECHACONTRATACION) "TIEMPO DE SERVICIO"
FROM EMPLEADOS E
ORDER BY  4 DESC ;
END;

VARIABLE TABLA REFCURSOR;
EXEC USP_TIEMPO_SERVICIO(:TABLA);
PRINT TABLA
-- PROC N°8
-- CONTEO DE LOS 10 DESTINOS MAS PROGRAMADOS  RESPECTO A LOS VUELOS PROGRAMADOS
CREATE OR REPLACE PROCEDURE USP_DESTINOS_VISITADOS (CRS OUT SYS_REFCURSOR)
AS
BEGIN
OPEN CRS FOR 
SELECT * FROM ( SELECT C.IDCIUDAD "CODIGO DESTINO",C.DETALLE "NOMBRE DESTINO",COUNT(IDVUELO) "CANTIDAD DE VUELOS"
                              FROM VUELOS V, CIUDADES C
                              WHERE V.CIUDAD_DESTINO = C.IDCIUDAD
                              GROUP BY  C.IDCIUDAD,C.DETALLE
                              ORDER BY 3 DESC )
 WHERE ROWNUM <= 10 ;
END;

VARIABLE TABLA REFCURSOR;
EXEC USP_DESTINOS_VISITADOS(:TABLA);
PRINT TABLA

-- PROC N°9
-- CLIENTES QUE COMPRAN MAS PAQUETES TURISTICOS  Y SU RESPECTIVO MONTO  20
CREATE OR REPLACE PROCEDURE USP_CLIENTES_PAQUETES (CRS OUT SYS_REFCURSOR)
AS
BEGIN
OPEN CRS FOR  
SELECT * FROM  ( SELECT C.IDCLIENTE ,RTRIM(C.APELLIDO_PATERNO) || ' ' ||RTRIM(C.APELLIDO_MATERNO) || ' ' || RTRIM(C.NOMBRE) "NOMBRE DE CLIENTE" ,COUNT(VPT.IDPAQUETE) "CANTIDAD PAQUETE",  SUM(VPT.PRECIO) "TOTAL"
                               FROM VENTAS_DE_PAQUETES_TURISTICO VPT,CLIENTES C
                               WHERE  VPT.IDCLIENTE = C.IDCLIENTE
                                GROUP BY C.IDCLIENTE ,RTRIM(C.APELLIDO_PATERNO) || ' ' ||RTRIM(C.APELLIDO_MATERNO) || ' ' || RTRIM(C.NOMBRE) 
                              ORDER BY 4 DESC )
 WHERE ROWNUM <= 20 ;
END;

VARIABLE TABLA REFCURSOR;
EXEC USP_CLIENTES_PAQUETES(:TABLA);
PRINT TABLA

-- PROC N°10
-- CONTAR Y SUMAR LAS VENTAS REALIZADAS POR CADA VENDEDOR 
CREATE OR REPLACE PROCEDURE USP_MONTOVENTAS (CRS OUT SYS_REFCURSOR)
AS
BEGIN
OPEN CRS FOR    SELECT E.IDEMPLEADO ,RTRIM(E.APELLIDO_PATERNO) || ' ' ||RTRIM(E.APELLIDO_MATERNO) || ' ' || RTRIM(E.NOMBRES) "NOMBRE DE CLIENTE" ,
                               COUNT(IDVENTA) "CANTIDAD DE VENTAS",  SUM(PRECIO_PASAJE - DESCUENTO) "TOTAL VENDIDO"
                               FROM VENTAS_DE_PASAJES VP,EMPLEADOS E
                               WHERE VP.IDPERSONAL = E.IDEMPLEADO
                             GROUP BY  E.IDEMPLEADO ,RTRIM(E.APELLIDO_PATERNO) || ' ' ||RTRIM(E.APELLIDO_MATERNO) || ' ' || RTRIM(E.NOMBRES) 
                             ORDER BY 4 ;
END;

VARIABLE TABLA REFCURSOR;
EXEC USP_MONTOVENTAS(:TABLA);
PRINT TABLA

