-- FUNCION 2
-- OBTENER EL MONTO TOTAL DE PASAJES DE CIERTO PERSONAL
CREATE OR REPLACE FUNCTION FDU_MONTO_VENTAS(CODIGO IN NCHAR)
RETURN NUMBER
IS
NUMERO NUMBER;
BEGIN
SELECT SUM(PRECIO_PASAJE) INTO NUMERO 
FROM VENTAS_DE_PASAJES
WHERE IDPERSONAL = CODIGO;
RETURN NUMERO;
END FDU_MONTO_VENTAS;

VARIABLE RC NUMBER
EXEC :RC := FDU_MONTO_VENTAS('EM00000017');
PRINT RC

