-- FUNCION 7
--  OBTENER LOS DATOS COMPLETOS DE UN EMPLEADO ATRAVES DE SU DNI
CREATE OR REPLACE FUNCTION FDU_EMPLEADOS_DNI(XDNI IN CHAR)
  RETURN SYS_REFCURSOR
IS
  CRS SYS_REFCURSOR;
BEGIN
  OPEN CRS
   FOR SELECT  *  FROM EMPLEADOS WHERE DNI = XDNI;
  RETURN CRS;
END;

VAR RC REFCURSOR;
EXEC :RC := FDU_EMPLEADOS_DNI('09157808');
PRINT RC

